import React, {useState} from 'react';
import { useTranslation } from 'react-i18next';
import '../styles/App.scss';
import '../styles/Footer.scss';
 
function Footer (){

    const { t, i18n } = useTranslation();

    return(
        <>
            <div className="contenderFooter">
                <h3>{t('footer.1')}</h3>
            </div>
        </>
    )
}

export default Footer;
